// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ECDSAVerifier {
    function getMessageHash(address _to, uint _amount, string memory _message, uint _nonce) public pure returns (bytes32) {
        return keccak256(abi.encodePacked(_to, _amount, _message, _nonce));
    }

    function getEthSignedMessageHash(bytes32 _messageHash) public pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", _messageHash));
    }

    function verify(address _signer, address _to, uint _amount, string memory _message, uint _nonce, bytes memory signature)
        public pure returns (bool)
    {
        bytes32 messageHash = getMessageHash(_to, _amount, _message, _nonce);
        bytes32 ethSignedMessageHash = getEthSignedMessageHash(messageHash);
        return recoverSigner(ethSignedMessageHash, signature) == _signer;
    }

    function recoverSigner(bytes32 _ethSignedMessageHash, bytes memory _signature) public pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);
        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function splitSignature(bytes memory sig) public pure returns (bytes32 r, bytes32 s, uint8 v) {
        require(sig.length == 65, "invalid signature length");
        assembly {
            r := mload(add(sig, 32))
            s := mload(add(sig, 64))
            v := byte(0, mload(add(sig, 96)))
        }
    }
}

contracts/M1_ECDSA.sol.content:
// Módulo 1: Assinaturas digitais e Prova de Trabalho
pragma solidity ^0.8.0;

contract M1_ECDSA {
    function verifySignature(address signer, bytes32 messageHash, bytes memory signature) public pure returns (bool) {
        return recoverSigner(messageHash, signature) == signer;
    }

    function recoverSigner(bytes32 messageHash, bytes memory signature) public pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(signature);
        return ecrecover(messageHash, v, r, s);
    }

    function splitSignature(bytes memory sig) public pure returns (bytes32 r, bytes32 s, uint8 v) {
        require(sig.length == 65, "invalid signature length");
        assembly {
            r := mload(add(sig, 32))
            s := mload(add(sig, 64))
            v := byte(0, mload(add(sig, 96)))
        }
    }
}

contracts/M2_UTXO_Account.sol.content:
// Módulo 2: Modelo UTXO e Modelo de Conta
pragma solidity ^0.8.0;

contract M2_UTXO_Account {
    struct UTXO {
        address owner;
        uint256 amount;
    }

    mapping(bytes32 => UTXO) public utxos;
    mapping(address => uint256) public balances;

    function createUTXO(bytes32 id, address owner, uint256 amount) public {
        utxos[id] = UTXO(owner, amount);
    }

    function transferAccount(address to, uint256 amount) public {
        require(balances[msg.sender] >= amount, "Insufficient balance");
        balances[msg.sender] -= amount;
        balances[to] += amount;
    }
}

